/************************************************************
 *
 * Autor: Zoinks
 *
 * 446576656c6f7065723a20416e746f6e20506f6c656e79616b61 ****/

// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.15;

import "./abstract/Context.sol";
import "./common/ERC20.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IERC20Metadata.sol";
import "./interfaces/IRouter.sol";
import "./librarys/SafeMath.sol";
import "./librarys/SafeERC20.sol";
import "./librarys/Math.sol";

contract CakePulse is ERC20 {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    //maximum-integer
    uint256 MAX_INT =
        0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
    // Whether it is initialized
    bool public isInitialized;
    //zoinks contract
    IERC20 public zoinks;
    // snacks contract
    IERC20 public snacks;
    //router contract address
    IRouter public zoinksRouter;
    // pancakeRouter contract address
    // TestNet strange address of pancake router 0x481454b78F5F6442b1dCD4C28C0bF4a16b7C8C21
    // TestNet real by https://docs.pancakeswap.finance/v/espanol/devs/migracion/cake-syrup-pool: 0xD99D1c33F9fC3444f8101754aBC46c52416550D1
    // MainNet BSC: 0x10ED43C718714eb63d5aA57B78B54704E256024E
    IRouter public pancakeRouter =
        IRouter(0x10ED43C718714eb63d5aA57B78B54704E256024E);
    //snackspool contract address
    address public snackspool;
    // cakepool contract address
    // TestNet strange address of cakepool 0x281F929FD3696f80e4dB0613804F6870265A39Ce
    // TestNet real by https://docs.pancakeswap.finance/v/espanol/devs/migracion/cake-syrup-pool: 0x683433ba14e8F26774D43D3E90DA6Dd7a22044Fe
    // MainNet 0x45c54210128a065de780C4B0Df3d16664f7f859e
    address public cakepool = 0x45c54210128a065de780C4B0Df3d16664f7f859e;
    //busd contract
    // Testnet our old BUSD token: 0xD0F7d3611d2faDc1838FBAc6c2Dbe19EC8cCE359
    // TestNet our new BUSD token: 0xAFA8413aB62B3e2A4C0E0Dbc460d32b89db93aFd
    // MainNet 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56
    IERC20 public busd = IERC20(0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56);
    // cake contract
    // TestNet strange address of cake 0xB4452E6DCa8bB6Ff5C14Df586bc03ec8Bc4b9094
    // TestNet real by https://docs.pancakeswap.finance/v/espanol/devs/migracion/cake-syrup-pool: 0xFa60D973F7642B748046464e165A65B7323b0DEE (Dummy Tokens)
    // MainNet 0x0E09FaBB73Bd3Ade0a17ECC321fD13a19e81cE82
    IERC20 public cake = IERC20(0x0E09FaBB73Bd3Ade0a17ECC321fD13a19e81cE82); // Is address of token? What is CakeToken, is our test token?

    event Circulate();

    constructor() ERC20("CAKEPULSE", "CAKEPULSE") {}

    /*
     * @notice Initialize the contract
     * @param _master: master contract address
     * @param _zoinks: zoinks token address
     * @param _snacks: snacks token address
     * @param _snackspool: snackspool contract address
     */
    function initialize(
        IRouter _zoinksRouter,
        IERC20 _zoinks,
        IERC20 _snacks,
        address _snackspool
    ) external {
        //require(!isInitialized, "Already initialized");

        // Make this contract initialized
        isInitialized = true;

        zoinksRouter = _zoinksRouter;
        zoinks = _zoinks;
        snacks = _snacks;
        snackspool = _snackspool;

        // Approve zoinks to snacks for buy(zoinks -> snacks)
        zoinks.approve(address(snacks), MAX_INT);
        // Approve snacks to snackspool for deposit(snacks to snacksPool)
        snacks.approve(address(snackspool), MAX_INT);
        // Approve zoinks to router for swap(zoinks to busd), add liquidity
        zoinks.approve(address(zoinksRouter), MAX_INT);
        // Approve busd to router for add liquidity
        busd.approve(address(zoinksRouter), MAX_INT);
        // Approve cake to router for swap(busd to cake)
        busd.approve(address(pancakeRouter), MAX_INT);
        // Approve cake to cakepool for deposit(cake to cakepool)
        cake.approve(address(cakepool), MAX_INT);
    }

    /*
     * @main entry point
     * @notice calculate amount of snacks corresponding amount of zoinks
     * @param zoinksAmount: amount of zoinks
     */

    function circulate() public {
        // 1. Get balance of contract
        uint256 snacksBalance = snacks.balanceOf(address(this));
        // 2. Stake Snacks -> Snacks Pool
        deposit(snackspool, snacksBalance);
        snacksBalance = snacks.balanceOf(address(this));
        // 3. Claim reward Snacks
        updatePool(snackspool);
        deposit(snackspool, 0);
        uint256 snacksReward = snacks.balanceOf(address(this)).sub(
            snacksBalance
        );
        // 4. Redeem reward Snacks to get Zoinks
        redeemSnacks(snacks, snacksReward);
        uint256 zoinksBalance = zoinks.balanceOf(address(this));
        // 5. Swap Zoinks to BUSD in Zoinks Router
        uint256 swappedAmount = swap(
            zoinksRouter,
            address(zoinks),
            address(busd),
            zoinksBalance
        );
        // 6. Swap BUSD to Cake in Pancake swap Router
        swappedAmount = swap(
            pancakeRouter,
            address(busd),
            address(cake),
            swappedAmount
        );
        // 7. Stake Cake to Cake Pool in Pancake swap
        deposit(cakepool, swappedAmount);
        // 8. Claim reward Cake in Pancake swap
        deposit(cakepool, 0);

        emit Circulate();
    }

    /*
     * @notice buy snacks/ethSnacks/btcSnacks corresponding amount of zoinks/eth/btc
     * @param _snacks: snacks/ethSnacks/btcSnacks contract
     * @param _amount: amount of zoinks/eth/btc
     * @param rate: rate of tokens
     */
    function buySnacks(
        IERC20 _snacks,
        uint256 _amount,
        uint256 rate
    ) public {
        uint256 amount = calculateBuyAmount(_snacks, _amount, rate);
        if (amount == 0) {
            return;
        }
        (bool success, bytes memory data) = address(_snacks).call(
            abi.encodeWithSelector(
                bytes4(keccak256(bytes("buy(uint256)"))),
                amount
            )
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "PULSE: BUY_SNACKS_FAILED"
        );
    }

    /*
     * @notice buyback snacks/ethSnacks/btcSnacks
     * @param _snacks: address of snacks/ethSnacks/btcSnacks
     * @param amount: amount of snacks/ethSnacks/btcSnacks to redeem
     */
    function redeemSnacks(IERC20 _snacks, uint256 amount) public {
        if (amount == 0) {
            return;
        }
        amount = amount.div(10**18);
        (bool success, bytes memory data) = address(_snacks).call(
            abi.encodeWithSelector(
                bytes4(keccak256(bytes("redeem(uint256)"))),
                amount
            )
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "PULSE: REDEEM_SNACKS_FAILED"
        );
    }

    /*
     * @notice deposit token to pool
     * @param amount: amount to deposit
     */
    function deposit(address pool, uint256 amount) public {
        (bool success, bytes memory data) = pool.call(
            abi.encodeWithSelector(
                bytes4(keccak256(bytes("deposit(uint256)"))),
                amount
            )
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "PULSE: DEPOSIT_POOL_FAILED"
        );
    }

    /*
     * @notice update pool for calculate reward
     */
    function updatePool(address pool) public {
        (bool success, bytes memory data) = pool.call(
            abi.encodeWithSelector(bytes4(keccak256(bytes("updatePool()"))))
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "PULSE: UPDATE_POOL_FAILED"
        );
    }

    /*
     * @notice swap tokens
     * @param amount: amount to swap
     */
    function swap(
        IRouter router,
        address from,
        address to,
        uint256 amount
    ) public returns (uint256) {
        if (amount == 0) {
            return 0;
        }
        uint256[] memory swappedAmount;
        address[] memory path = new address[](2);
        path[0] = from;
        path[1] = to;
        swappedAmount = router.swapExactTokensForTokens(
            amount,
            0,
            path,
            address(this),
            0xffffffff
        );
        return swappedAmount[1];
    }

    /*
     * @notice add liquidity with zoinks and busd
     * @param amount: amount of zoinks and busd
     */
    function addLiquidity(IRouter router, uint256 amount)
        public
        returns (uint256)
    {
        if (amount == 0) {
            return 0;
        }
        (, , uint256 liquidity) = router.addLiquidity(
            address(zoinks),
            address(busd),
            amount,
            amount,
            0,
            0,
            address(this),
            0xffffffff
        );
        return liquidity;
    }

    /*
     * @notice calculate amount of snacks/ethSnacks/btcSnacks corresponding amount of zoinks/etc/btc
     * @param _snacks: snacks/ethSnacks/btcSnacks contract
     * @param _amount: amount of zoinks/eth/btc
     * @param rate: rate of tokens
     */
    function calculateBuyAmount(
        IERC20 _snacks,
        uint256 _amount,
        uint256 rate
    ) public view returns (uint256) {
        if (_amount == 0) {
            return _amount;
        }
        uint256 _snacksAmount;
        uint256 totalSupply = _snacks.totalSupply().div(10**18);
        totalSupply = totalSupply.mul(2).add(1);
        _snacksAmount = Math.sqrt(
            (totalSupply**2).add(_amount.mul(8).div(rate))
        );
        _snacksAmount = _snacksAmount.sub(totalSupply).div(2);
        return _snacksAmount;
    }
}
